import React from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import './Che'

// Компонент для відображення повідомлень про помилки
const ErrorComponent = ({ errors }) => (
  <div className="error-messages">
    {Object.keys(errors).map((field) => (
      <p key={field}>{errors[field]}</p>
    ))}
  </div>
);

const CheckoutForm = ({ onSuccess }) => {
  // Схема валідації з використанням Yup
  const validationSchema = Yup.object().shape({
    firstName: Yup.string()
      .required('First Name is required')
      .max(20, 'First Name must be at most 20 characters'),
    lastName: Yup.string()
      .required('Last Name is required')
      .max(20, 'Last Name must be at most 20 characters'),
    email: Yup.string()
      .required('Email is required')
      .email('Email format is incorrect'),
    phone: Yup.string()
      .required('Phone number is required')
      .matches(/^\d+$/, 'Phone number must contain only digits')
      .min(10, 'Phone number must be at least 10 digits'),
    address: Yup.string()
      .required('Address is required')
      .max(100, 'Address must be at most 100 characters'),
  });

  return (
    <Formik
      initialValues={{
        firstName: '',
        lastName: '',
        email: '',
        phone: '',
        address: '',
      }}
      validationSchema={validationSchema}
      onSubmit={(values) => {
        console.log('Form submitted:', values);
        onSuccess();
      }}
    >
      {({ errors, touched }) => (
        <Form>
          <h1>Checkout</h1>
          <div>
            <label>First Name</label>
            <Field name="firstName" type="text" />
            <ErrorMessage name="firstName" />
          </div>
          <div>
            <label>Last Name</label>
            <Field name="lastName" type="text" />
            <ErrorMessage name="lastName" />
          </div>
          <div>
            <label>Email</label>
            <Field name="email" type="email" />
            <ErrorMessage name="email" />
          </div>
          <div>
            <label>Phone</label>
            <Field name="phone" type="text" />
            <ErrorMessage name="phone" />
          </div>
          <div>
            <label>Address</label>
            <Field name="address" type="text" />
            <ErrorMessage name="address" />
          </div>
          <ErrorComponent errors={errors} />
          <button type="submit">Continue</button>
        </Form>
      )}
    </Formik>
  );
};

const SuccessPage = () => (
  <div className="success-page">
    <h1>Success!</h1>
    <p>Your order was sent to processing!</p>
    <button onClick={() => (window.location.href = '/')}>
      Go back to Catalog
    </button>
  </div>
);

const App = () => {
  const [submitted, setSubmitted] = React.useState(false);

  return (
    <div>
      {!submitted ? (
        <CheckoutForm onSuccess={() => setSubmitted(true)} />
      ) : (
        <SuccessPage />
      )}
    </div>
  );
};

export default App;
